import "./form.css";

interface formData {
    form: any
}

const Form = ({form}: formData) => {


    const seperatedForm = form.map((item: string) => {
        return form.split(item);
    });

    switch (seperatedForm) {
        case 'W':
            return <td className="form-win">W</td>;
        case 'D': 
            return <td className="form-draw">D</td>;
        case 'L': 
           return <td className="form-loss">L</td>;

    }

    return( 
        <>{seperatedForm}</>
    );
}

export default Form;
